import React ,{Component}from 'react';
import Posts from '../Posts/Posts';
import Pagination from '../Pagination/Pagination'; 
import './Wrapper.css'
class Wrapper extends Component{
    render(){
        return(
            <React.Fragment className = "Wrapper">
                <Posts/>
                <Pagination/>
            </React.Fragment>
        )
    }
}

export default Wrapper;
